void KeyBoardContainerBase::buttonCallbackHandler(const touchgfx::AbstractButton& src)
{
    if (&src == &buttonShift)
    {
        //Interaction1
        //When buttonShift clicked call virtual function
        //Call buttonShiftHandler
        buttonShiftHandler();
    }
    if (&src == &buttonBackspace)
    {
        //Interaction28
        //When buttonBackspace clicked call virtual function
        //Call buttonBackspaceHandler
        buttonBackspaceHandler();
    }
    if (&src == &buttonSpace)
    {
        //Interaction29
        //When buttonSpace clicked call ButtonAction1 on KeyBoardContainer
        //Call ButtonAction1
        ButtonAction1(' ');
    }
    if (&src == &buttonNumber)
    {
        //Interaction30
        //When buttonNumber clicked call virtual function
        //Call buttonNumberHandler
        buttonNumberHandler();
    }
    if (&src == &buttonConfirm)
    {
        //Interaction50
        //When buttonConfirm clicked emit OKButtonTriggers callback
        //Emit callback
        emitOKButtonTriggersCallback(1);
    }
}

